<script>
import { onMounted } from "vue";
import { useCartStore } from "../../stores/cart";

export default {
  props: ["data", "seatReserved"],
  setup(props) {
    const cartStore = useCartStore();
    const seatClassSuperVip = ["A", "B", "C"];
    const seatClassVip = ["AA", "BB", "CC", "DD", "EE", "FF"];
    onMounted(() => {
      const seatMapItems = document.querySelectorAll(".seat-map-item");
      for (let i = 0; i < seatMapItems.length; i++) {
        // seatMapItems[i].addEventListener("click");
      }
    });
    function handleSeatSelected(seatId) {
      if (props.seatReserved.includes(seatId)) return;
      let price, seatClassName;
      const [seatClass] = seatId.split("-");
      switch (true) {
        case seatClassSuperVip.includes(seatClass):
          price = props.data.price[2];
          seatClassName = "SuperVIP";
          break;
        case seatClassVip.includes(seatClass):
          price = props.data.price[1];
          seatClassName = "VIP";
          break;
        default:
          price = props.data.price[0];
          seatClassName = "Economy";
      }
      if (cartStore.seatSelected(props.data._id).includes(seatId)) {
        cartStore.removeSeatFromCart(props.data._id, seatClassName, seatId);
        return;
      }
      const group = "guitarshow";
      const _id = props.data._id;
      cartStore.addToCart({
        _id,
        group,
        image: props.data.logo,
        name: props.data.name,
        seatClass: seatClassName,
        seatId,
        price,
        count: 1,
      });
    }
    return { handleSeatSelected, cartStore };
  },
};
</script>

