.seat-map > svg {
  width: 100%;
}
.seat-map-item:hover {
  cursor: pointer;
  fill: #b9dea0;
}
.seat-map-item.reserved {
  fill: #bbb;
  cursor: initial;
}
.seat-map-item.selected {
  fill: red;
}
</style>
